  "marketplace_integration_app_dec_office_preview": "<p>Smooth online preview of office files on datasheet, allowing you to view common office files such as Excel, Word, PPT, etc. on your desktop or mobile anywhere, anytime</p>\n\n<ul>\n<li>Online preview of .doc, .docx, .xls, .xlsx, .ppt, .pptx, and .pdf formatted office files</li>\n<li>Desktop and mobile both support file previews of the above formats</li>\n</ul>\n\n<p>Additional notes:</p>\n<ul>\n<li>This feature is powered by \"Yoncentric Cloud Conversion\" and officially integrated</li>\n<li>Click the \"Enable\" button below to enable this integration and agree that \"Yoncentric Cloud Conversion\" reads the office files you want to preview</li>\n<li>If you no longer need the office files preview feature, the space admin can disable it on this page</li>\n</ul>",
