  "api_panel_type_desc_created_by": "创建此记录的成员（unit），以数组形式返回  「组织单元」是维格云中描述“空间站”与“成员”之间的关系的一个抽象概念。成员（member）、小组（team）都是一种组织单元。  *创建人必须为成员（member） unitId (string) : 组织单元的ID unitType (number) : 组织单元的类型，1是小组，3是成员 unitName (string) : 组织单元的名称，如果unitType是1，此值为小组名称；如果unitType是3，此值为成员站内昵称",
  "api_panel_type_desc_last_modified_by": "最近一次编辑记录/指定字段的成员（unit），以数组形式返回  「组织单元」是维格云中描述“空间站”与“成员”之间的关系的一个抽象概念。成员（member）、小组（team）都是一种组织单元。  *修改人必须为成员（member） unitId (string) : 组织单元的ID unitType (number) : 组织单元的类型，1是小组，3是成员 unitName (string) : 组织单元的名称，如果unitType是1，此值为小组名称；如果unitType是3，此值为成员站内昵称",
  "api_panel_type_desc_member": "由若干「组织单元（unit）」组成的数组  「组织单元」是维格云中描述“空间站”与“成员”之间的关系的一个抽象概念。成员（member）、小组（team）都是一种组织单元。  id (string) : 组织单元的ID type (number) : 组织单元的类型，1是小组，3是成员 name (string) : 组织单元的名称，如果 type 是1，此值为小组名称；如果 type 是3，此值为成员站内昵称",
