  "api_panel_type_default_example_url": "{\"title\":\"vika\",\"text\":\"https://vika.cn\", \"favicon\":\"https://s4.vika.cn/space/2022/12/20/73456950217f4f79b20c7ef1a49acf6e\"}",
  "api_panel_type_desc_created_by": "創建此記錄的成員（unit），以數組形式返回  「組織單元」是維格雲中描述“空間站”與“成員”之間的關係的一個抽象概念。成員（member）、小組（team）都是一種組織單元。 *創建人必須為成員（member） unitId (string) : 組織單元的ID unitType (number) : 組織單元的類型，1是小組，3是成員 unitName (string) : 組織單元的名稱，如果unitType是1，此值為小組名稱；如果unitType是3，此值為成員站內暱稱",
  "api_panel_type_desc_last_modified_by": "最近一次編輯記錄/指定字段的成員（unit），以數組形式返回  「組織單元」是維格雲中描述“空間站”與“成員”之間的關係的一個抽象概念。成員（member）、小組（team）都是一種組織單元。 *修改人必須為成員（member） unitId (string) : 組織單元的ID unitType (number) : 組織單元的類型，1是小組，3是成員 unitName (string) : 組織單元的名稱，如果unitType是1，此值為小組名稱；如果unitType是3，此值為成員站內暱稱",
  "api_panel_type_desc_member": "由若干「組織單元（unit）」組成的數組  「組織單元」是維格雲中描述“空間站”與“成員”之間的關係的一個抽象概念。成員（member）、小組（team）都是一種組織單元。 id (string) : 組織單元的ID type (number) : 組織單元的類型，1是小組，3是成員 name (string) : 組織單元的名稱，如果 type 是1，此值為小組名稱；如果 type 是3，此值為成員站內暱稱",
